import { useState, useEffect } from 'react';
import TableRowData from './TableRowData';

const Perform = ()=>{

    const [data, setData] = useState([]);

    function fetchData(){

        fetch("https://blynk.cloud/external/api/get?token=UOkSf2Xaz1XFZbelzqZklo5E5lkJq-Ae&D1")
        .then((res) => res.json())
        .then((json) => {
            console.log(json);
            setData((data) => [
                ...data,
                json
            ]);
        });
    }

    function UpdataData(value){
        fetch("https://blynk.cloud/external/api/update?token=UOkSf2Xaz1XFZbelzqZklo5E5lkJq-Ae&V0=0.7")
    }
    return(
        <div className='Perform'>
          <div className="headPerform">Forward Bias Silicon Diode</div>
          <div className="controls">
              <h1>Controls</h1>
              <hr  className='ctrlHr'/>
              <div className="dcIn">
                <h4>DC volt : <span>0</span>V</h4>
                <input type="range" name="Voltage" />
              </div>
              <div className="btns">
                  <div className="btnsbtn">Send to hardware</div>
                  <div className="btnsbtn">Add To Table</div>
                  <div className="btnsbtn">Plot</div>
                  <div className="btnsbtn">Clear</div>
              </div>
          </div>
              <div className="ExpTable">
                  <table>
                      <tr>
                          <th>Forward Voltage(Volt)</th>
                          <th>Forward Current(mAmp)</th>
                      </tr>
                      {
                        
                          <TableRowData data={data}/>

                      }
                  </table>
              </div>
        </div>
    )
}

export default Perform;
